function RegForm() {
  return (
    <div className="reg">
      <img src="../images/auth/logo.svg" className="reg__logo" />
      <span className="reg__title">Регистрация</span>
      <form className="reg__form">
        <div className="reg__input__list"></div>
      </form>
    </div>
  );
}

export default RegForm;
